/*hooks */
import useCard from  './useCard';
import { CSSTransition } from 'react-transition-group';
const Card = ()=>{
    //const [buttonRef,IsActive] = useCard();
    return (
        <CSSTransition
            in ={true}
            classNames = 'my-node'
            timeout = {300}

        >
            <div className  = {Styles.card}>
            </div>

        </CSSTransition>
        
    )
}
export default Card;
